import React, { useEffect, useState } from "react";
import jwt_decode from 'jwt-decode';
import { BrowserRouter as Router, Routes, Route, useNavigate, Navigate } from 'react-router-dom';
import { GoogleLogin, useGoogleLogin, GoogleOAuthProvider } from "@react-oauth/google";


function Login() {
    const ggClientId = '412920764604-j8act2t26db6ci1jq74bdj3fd7ju64bd.apps.googleusercontent.com';
    let navigate = useNavigate();





    useEffect(() => {
        const gLogin = useGoogleLogin({
            onSuccess: tokenResponse => console.log(tokenResponse),
        });

    }, []);

    return (
        <div>
            <GoogleOAuthProvider clientId={ggClientId}>
                <GoogleLogin
                    onSuccess={credentialResponse => {
                        console.log(credentialResponse);
                        var obj = jwt_decode(credentialResponse.credential);
                        let test = JSON.stringify(obj)
                        console.log(test);
                    }}
                    onError={() => {
                        console.log('Login failed.')
                    }}
                />



            </GoogleOAuthProvider>

            <div onClick={gLogin}>
                    Test
                </div>
        </div>
    );
}

export default Login;
